(9, 'copy_payment_gateway', 'a:1:{i:0;a:2:{s:6:"prefix";s:7:"default";s:4:"copy";s:6121:"<p><strong><span xss=removed>How to pay with ATM Mandiri / Bersama</span></strong></p>\n<ol>\n<li><span xss=removed>On the main menu, choose <strong>Others</strong></span></li>\n<li><span xss=removed>Choose <strong><span lang=\\"PT\\" xss=removed>Transfer</span></strong></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed>Choose <strong><span lang=\\"DE\\" xss=removed>Online Transfer</span></strong></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed>Enter <strong>##banknumber##</strong></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed>Enter the full amount to be paid. If the amount entered is not the same as the invoiced amount, the transaction will be declined</span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed>Empty the transfer reference number and press <strong><span lang=\\"PT\\" xss=removed>Correct</span></strong></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed>Amount to be paid, account number, and merchant name will appear on the payment confirmation page. If the information is right, press <strong>Correct</strong></span></span></span></span></li>\n</ol>\n<p><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><strong xss=removed><span xss=removed>How to pay with ATM BCA / Prima</span></strong></span></span></span></span></p>\n<ol>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed>On the main menu, choose <strong>Others</strong></span></span></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed>Choose <strong><span lang=\\"PT\\" xss=removed>Transfer</span></strong></span></span></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed><span lang=\\"PT\\" xss=removed>Choose <strong>Other Bank Account</strong></span></span></span></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed><span lang=\\"PT\\" xss=removed>Enter <strong>013 </strong>(Bank Permata code) and choose <strong>Correct</strong></span></span></span></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed><span lang=\\"PT\\" xss=removed>Enter the full amount to be paid. If the amount entered is not the same as the invoiced amount, the transaction will be declined</span></span></span></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed><span lang=\\"PT\\" xss=removed>Enter (<strong>##banknumber##</strong>) and press <strong>Correct</strong></span></span></span></span></span></span></li>\n<li><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed><span lang=\\"PT\\" xss=removed>Amount to be paid, account number, and merchant name will appear on the payment confirmation page. If the information is right, press <strong>Correct</strong></span></span></span></span></span></span></li>\n</ol>\n<p><span xss=removed><span lang=\\"PT\\" xss=removed><span lang=\\"DE\\" xss=removed><span lang=\\"PT\\" xss=removed><span xss=removed><span lang=\\"PT\\" xss=removed><strong xss=removed><span xss=removed>How to pay with ATM Permata / Alto</span>